(727, '_transient_dash_4077549d03da2e451c8b5f002294ff51', '<div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://wordpress.org/news/2015/04/powell/''>WordPress 4.2 “Powell”</a> <span class="rss-date">April 23, 2015</span><div class="rssSummary">Version 4.2 of WordPress, named “Powell” in honor of jazz pianist Bud Powell, is available for download or update in your WordPress dashboard. New features in 4.2 help you communicate and share, globally. An easier way to share content Clip it, edit it, publish it. Get familiar with the new and improved Press This. From [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=''rsswidget'' href=''http://ma.tt/2015/04/entanglement/''>Matt: Entanglement</a></li><li><a class=''rsswidget'' href=''http://ma.tt/2015/04/100-books/''>Matt: 100 Books</a></li><li><a class=''rsswidget'' href=''http://www.mojomarketplace.com/dojo/wordpress-plugin-theme-security-vulnerability/?utm_source=wp-pipes&#038;utm_campaign=wp-pipes&#038;utm_medium=rss''>WordPress Plugin &amp; Theme Security Vulnerability</a></li></ul></div><div class="rss-widget"><ul><li class=''dashboard-news-plugin''><span>Popular Plugin:</span> <a href=''https://wordpress.org/plugins/ml-slider/'' class=''dashboard-news-plugin-link''>Meta Slider</a>&nbsp;<span>(<a href=''plugin-install.php?tab=plugin-information&amp;plugin=ml-slider&amp;_wpnonce=a8a25e90a7&amp;TB_iframe=true&amp;width=600&amp;height=800'' class=''thickbox'' title=''Meta Slider''>Install</a>)</span></li></ul></div>', 'no');
